const Onboarding = ({ id, title }: { id: number, title: string }) => {

	const db = useSQLiteContext();

	const { width } = useWindowDimensions();
	const theme = useTheme();
	const router = useRouter();
	async function setValidated() {
		try {
			await setItemAsync('currency', 'USD');
			await setItemAsync('currentUserId', '1');
			await db.runAsync(`INSERT INTO users (name) VALUES('User')`);
			await db.runAsync(`
        INSERT INTO categories (userId, categName, categColor, categIcon) 
        VALUES (1, '${DefaultCategories[0].name}', '${DefaultCategories[0].color}', '${DefaultCategories[0].icon}'),
        (1, '${DefaultCategories[1].name}', '${DefaultCategories[1].color}', '${DefaultCategories[1].icon}'),
        (1, '${DefaultCategories[2].name}', '${DefaultCategories[2].color}', '${DefaultCategories[2].icon}'),
        (1, '${DefaultCategories[3].name}', '${DefaultCategories[3].color}', '${DefaultCategories[3].icon}'),
        (1, '${DefaultCategories[4].name}', '${DefaultCategories[4].color}', '${DefaultCategories[4].icon}'),
        (1, '${DefaultCategories[5].name}', '${DefaultCategories[5].color}', '${DefaultCategories[5].icon}');
        `);
		} catch (err) {
			console.log(err)
		}


	}
	return (
		<View style={[styles.container, { width }, { backgroundColor: theme.colors.background }]}>
			<View style={{ height: 200, overflow: 'visible' }}>
				<Text style={styles.hugeText}>{id == 1 ? "Enter the future of expense tracking here!" : ""}</Text>
			</View>
			<View>
				{id == 1 ?
					<Flag color={theme.colors.onBackground} />
					: id == 2 ?
						<Inspect color={theme.colors.onBackground} />
						: id == 3 ?
							<Chilling color={theme.colors.onBackground} />
							: <Flag color={theme.colors.onBackground} />
				}
			</View>
			<Text style={styles.title}>{title}</Text>
			{id == 3 ? <Button mode='contained' onPress={() => {
				setValidated();
				router.replace('/ChooseCurrency')
			}} style={styles.btn} labelStyle={{ fontSize: 16 }}>Start tracking</Button> : <Icon source={"gesture-swipe-left"} size={30} color={theme.colors.primary} />}
		</View>
	)
}

const styles = StyleSheet.create({
	container: {
		flex: 1,
		justifyContent: 'center',
		alignItems: 'center',
		gap: 8,
		paddingHorizontal: 24
	},
	title: {
		fontSize: 24,
		fontWeight: 'bold',
	},
	hugeText: {
		fontSize: 42,
		fontWeight: 'bold',
		marginBottom: 20,
	},
	btn: {
		width: 160,
		borderRadius: 4,
		marginTop: 20,
		paddingVertical: 2,
	}
})
export default Onboarding